import Link from "next/link";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  link: {
    color: "#8e7329",
  },
});

export default function Sections() {
  const classes = useStyles();
  return (
    <div>
      <Link href="/sale">
        <a>
          <Typography className={classes.link}>Sale</Typography>
        </a>
      </Link>
      <Link href="/sympathy">
        <a>Sympathy</a>
      </Link>
      <Link href="/gifts">
        <a>Gifts</a>
      </Link>
      <Link href="/plants">
        <a>Plants</a>
      </Link>
      <Link href="/birthday">
        <a>Birthday</a>
      </Link>
      <Link href="/samedaydelivery">
        <a>
          <Typography color="#8e7329">Same Day Delivery</Typography>
        </a>
      </Link>
    </div>
  );
}
